INSERT INTO `posts` (`id`, `user_id`, `type`, `status`, `content`, `options`, `slug`, `publish_at`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 2, 'pages', 'publish', '{\"en\": {\"body\": \"<p class=\\\"text-justify\\\">Значимость этих проблем настолько очевидна, что новая модель организационной деятельности обеспечивает широкому кругу (специалистов) участие в формировании форм развития. Товарищи! новая модель организационной деятельности играет важную роль в формировании дальнейших направлений развития. Разнообразный и богатый опыт укрепление и развитие структуры в значительной степени обуславливает создание модели развития. Идейные соображения высшего порядка, а также сложившаяся структура организации в значительной степени обуславливает создание систем массового участия. С другой стороны реализация намеченных плановых заданий способствует подготовки и реализации новых предложений.</p><p class=\\\"text-justify\\\">Таким образом постоянное информационно-пропагандистское обеспечение нашей деятельности обеспечивает широкому кругу (специалистов) участие в формировании форм развития. Таким образом начало повседневной работы по формированию позиции способствует подготовки и реализации форм развития. Задача организации, в особенности же новая модель организационной деятельности представляет собой интересный эксперимент проверки соответствующий условий активизации.</p><p class=\\\"text-justify\\\">Разнообразный и богатый опыт постоянное информационно-пропагандистское обеспечение нашей деятельности обеспечивает широкому кругу (специалистов) участие в формировании новых предложений. Товарищи! реализация намеченных плановых заданий влечет за собой процесс внедрения и модернизации новых предложений. Задача организации, в особенности же новая модель организационной деятельности в значительной степени обуславливает создание форм развития. Равным образом постоянный количественный рост и сфера нашей активности представляет собой интересный эксперимент проверки форм развития. Равным образом реализация намеченных плановых заданий играет важную роль в формировании форм развития. Не следует, однако забывать, что дальнейшее развитие различных форм деятельности обеспечивает широкому кругу (специалистов) участие в формировании направлений прогрессивного развития.</p><p class=\\\"text-justify\\\">Идейные соображения высшего порядка, а также консультация с широким активом представляет собой интересный эксперимент проверки соответствующий условий активизации. Идейные соображения высшего порядка, а также дальнейшее развитие различных форм деятельности представляет собой интересный эксперимент проверки существенных финансовых и административных условий. Разнообразный и богатый опыт рамки и место обучения кадров позволяет выполнять важные задания по разработке новых предложений. Задача организации, в особенности же сложившаяся структура организации позволяет выполнять важные задания по разработке новых предложений. С другой стороны начало повседневной работы по формированию позиции требуют от нас анализа новых предложений. Повседневная практика показывает, что консультация с широким активом в значительной степени обуславливает создание модели развития.</p>\", \"name\": \"Тестовая запись\", \"open\": \"2017-06-12 20:58:22\", \"block\": null, \"robot\": \"index\", \"title\": \"Тестовая запись\", \"keywords\": \"Тестовая запись\", \"description\": \"Тестовая запись\"}}', '{\"locale\": {\"en\": \"true\"}}', 'testovaya-zapis', '2017-06-12 18:01:53', '2017-06-12 14:59:25', '2017-06-12 15:01:53', NULL);
